  ,\n\t\"ETLUpdateDate\",\n\t\"ETLDeleteDate\",\n\t\"BounceType\"\n) as\n/*Model:ODS_LS.MARKETO.EMAIL_BOUNCED\n\
  Author: Bharath Bachu\nDate: 11/01/23\nDescription:\nChange Date: 11/01/23\nChnage\
  \ Notes: Bharath rename to correct the spelling. estVariant renameed as  TestVariant\n\
  STRY2571434 - Added Bounce Type for filtering delivered, opened\n\n*/\nSELECT \"\
  ID\" as \"ID\",\n       \"MARKETOGUID\" as \"MarketoGUID\",\n       \"LEADID\" as\
  \ \"LeadID\",\n       \"ACTIVITYDATE\" as \"ActivityDate\",\n       \"ACTIVITYTYPEID\"\
  \ as \"ActivityTypeIID\",\n       \"PRIMARYATTRIBUTEVALUEID\" as \"PrimaryAttributeValueID\"\
  ,\n       \"PRIMARYATTRIBUTEVALUE\" as \"PrimaryAttributeValue\",\n       \"CAMPAIGNID\"\
  \ as \"CampaignID\",\n       \"CAMPAIGN\" as \"Campaign\",\n       \"CAMPAIGN_RUN_ID\"\
  \ as \"CampaignRunID\",\n       \"CHOICE_NUMBER\" as \"ChoiceNumber\",\n       \"\
