  \ as \"HasPredective\",\n       \"STEP_ID\" as \"StepID\",\n       \"CATEGORY\"\
  \ as \"Category\",\n       \"SUBCATEGORY\" as \"SubCategory\",\n       \"TEST_VARIANT\"\
  \ as \"TestVariant\",\n       \"ETL_INSERT_DATE\" as \"ETLInsertDate\",\n      \
  \ \"ETL_UPDATE_DATE\" as \"ETLUpdateDate\",\n       \"ETL_DELETE_DATE\" as \"ETLDeleteDate\"\
  ,\n        case when \"ACTIVITYTYPEID\" = 'random' then 'random' else 'random' end\
  \ as \"BounceType\"\n   FROM \"RDS\".\"MARKETO\".\"EMAIL_BOUNCED\" ;"
